import React from "react";

import Header from "./components/Header/Header";

import AsideMenu from "./components/AsideMenu/AsideMenu";

function App() {
  return (
    <React.Fragment>
      <AsideMenu />
      <Header />
    </React.Fragment>
  );
}

export default App;
